import { BlankCallActionType } from '../actiontype/blank-call.actiontype';
const initialState = {
  blankCallApiResponse: {}
};

export default function blankCallReducer(state = initialState, action) {
  switch (action.type) {
    case BlankCallActionType.BLANK_CALL_REQUEST:
      return {
        ...state, blankCallApiResponse: action.payload
      };
    case BlankCallActionType.BLANK_CALL_SUCCESS:
      return {
        ...state,
        blankCallApiResponse: action.payload
      };
    case BlankCallActionType.BLANK_CALL_FAILURE:
      return {
        ...state,
        blankCallApiResponse: action.payload
      };
    default:
      return state
  }
}
